"use strict";

function getHint(secret, guess) {
    let x = 0, y = 0;
    let cnt1 = Array(10).fill(0);
    let cnt2 = Array(10).fill(0);
    for (let i = 0; i < secret.length; i++) {
        if (secret[i] === guess[i]) {
            x += 1;
        } else {
            cnt1[parseInt(secret[i])] += 1;
            cnt2[parseInt(guess[i])] += 1;
        }
    }
    for (let i = 0; i < 10; i++) {
        y += Math.min(cnt1[i], cnt2[i]);
    }
    return `${x}A${y}B`;
}
